import React, { Component } from 'react';
import './App.css';
import Header from './components/Header';
import Post from './components/Post';

class App extends Component {
  render() {
    return <div className="App">
        <Header />
        <section className="App-main">
          <Post nickname="Bill Portões  " avatar="https://pbs.twimg.com/profile_images/988775660163252226/XpgonN0X_400x400.jpg" caption="Look the new Windows 10!!" image="https://t.tudocdn.net/319163?w=646&h=284" />
          <Post nickname="Linus Torvalds  " avatar="https://media.newyorker.com/photos/5ba177da9eb2f7420aadeb98/master/pass/Cohen-Linus-Torvalds.jpg" caption="Linux is free! haha" image="https://e-tinet.com/wp-content/uploads/2017/02/MELHORES-DISTRIBUICOES-LINUX-RODAR-SERVIDORES-1024x536.png" />

          {/* more posts */}
          <button>Atualizar</button>
          <button>Postar</button>
        </section>

      </div>;
  }
}

export default App;
